import React from 'react';
import './Schedule.css';

function Schedule() {
  // Solo días de lunes a viernes
  const days = ['Lunes', 'Martes', 'Miércoles', 'Jueves', 'Viernes'];

  // Horas de 8:00 a 14:00
  const hours = ['8:00', '9:00', '10:00', '11:00', '12:00', '13:00', '14:00'];

  return (
    <section className="schedule">
      <h2>Agenda una nueva cita</h2>
      <div className="time-grid">
        {/* Encabezado vacío para la primera celda */}
        <div className="day"></div>

        {/* Encabezados de los días */}
        {days.map((day, index) => (
          <div key={index} className="day">{day}</div>
        ))}

        {/* Horas y celdas para cada día */}
        {hours.map((hour, i) => (
          <React.Fragment key={`row-${i}`}>
            <div className="time-slot">{hour}</div>
            {days.map((_, j) => (
              <div key={`slot-${i}-${j}`} className="time-slot">{/* celda vacía */}</div>
            ))}
          </React.Fragment>
        ))}
      </div>
    </section>
  );
}

export default Schedule;
